import React, { Component } from 'react'

export class Ind_Person extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div>
                <h1>Hello</h1>
                {(() => {
                    if (this.props.data == null) {
                    return (
                        <h1>Loading</h1>
                    )
                    } else {
                    return (
                        console.log(this.props.person)
                    )
                    }
                })()}
            </div>
        )
    }
}

export default Ind_Person
